import React from 'react';

const artdetails = (props) => {
    return(
        <div className="ArtDetails">
            <p>{props.name}</p>
            <p>{props.shortdesc}</p>
            <p>{props.description}</p>
            <p>{props.price}</p>
        </div>
    )
}

export default artdetails;
